import React,{useState,useEffect} from "react";


function App() {
  const [persons, setPersons] = useState([]);

  // first data grab
    useEffect(() => {
      fetch("https://gorest.co.in/public/v1/users") // your url may look different
        .then(resp => resp.json())
        .then(data => setPersons(data)) // set data to state
    }, []);
console.log(persons)

  return (
    <table className="table table-striped">
    <thead>
            <tr>
              <th> ID</th>
              <th>Name</th>
              <th>Email</th>
              <th>Gender</th>
              <th>Status</th> 
            </tr>
          </thead>
          <tbody>

        {(persons.data).map((person) => 
                <tr key={person.id}>
                <td>{person.id}</td>
                <td>{person.name}</td>
                <td>{person.email}</td>
                <td>{person.gender}</td>
                <td>{person.status}</td>
                </tr>
              )}
          </tbody>
        </table>
  );
}

export default App;
